import React from 'react';
import './App.css';



class DetailsPokemon extends React.Component {
    render() {
        const { name, type, image, moreInfo} = this.props.pokemons;

        const itemList =item=>{
            return <li>{item}</li>
        }
        return (
            <div className="Details">
                <span>{name}</span>
                <ul>
                    {itemList(type)}
                    {itemList(image)}
                    {itemList(moreInfo)}
                </ul>
            </div>
        )
    }
}

export default DetailsPokemon;
